from math import atan2, degrees

def calc(dx, dy, d, w, a):
    if dx ** 2 + dy ** 2 >= a ** 2:
        return 0
    t = degrees(atan2(dy, dx))
    for i in range(2):
        if w - d / 2 <= t + 360 * i <= w + d / 2:
            return 1
    return 0

def find_best_house_for_plum_scent(H, R, HS, U, M, S, du, dm, ds, US, MS, SS, wind_records):
    ans = [0] * H
    for (w, a) in wind_records:
        for (i, (x, y)) in enumerate(HS):
            if not calc(x, y, du, w, a):
                continue
            if any((calc(x - x0, y - y0, du, w, a) for (x0, y0) in US)) or any((calc(x - x0, y - y0, dm, w, a) for (x0, y0) in MS)) or any((calc(x - x0, y - y0, ds, w, a) for (x0, y0) in SS)):
                continue
            ans[i] += 1
    m = max(ans)
    if m:
        res = [i + 1 for i in range(H) if m == ans[i]]
        return res
    else:
        return ['NA']

